import React from 'react';
import { Button, List, ListItem, ListItemText, ListItemSecondaryAction } from '@mui/material';

const BookList = ({ books, onAdd }) => {
  return (
    <Grid container spacing={2}>
    {books.map((book) => (
      <Grid item xs={12} sm={6} md={4} key={book.id}>
        <img src={book.coverPhotoURL} alt={book.title} style={{ maxWidth: '100%', height: 'auto' }} />
        <Typography variant="subtitle1">{book.title}</Typography>
        <Typography variant="body2" color="textSecondary">{book.author}</Typography>
      </Grid>
    ))}
  </Grid>
  );
};

export default BookList;
